import React from 'react';
import './FaceRecognition.css'; 

const FaceRecognition = ({ imageUrl, box }) => {
    return (
        <div className="center">
            <div className="center ba bw2 b--dark-pink form center pa4 br3 shadow-5">
                <img id="inputImage" alt="facerecogimg" src={ imageUrl }></img>
                <div className="bounding-box" style={{top: box.leftCol, right: box.topRow, bottom: box.rightCol, left: box.bottomRow }}></div>
            </div>
        </div>
    );
}

export default FaceRecognition
